import React from 'react'
import axios from 'axios'
import Header from '../components/header'
import Search from '../components/search'
import Item from '../components/item'
class Home extends React.Component {

  constructor(props){
    super(props)    
      this.state={
        courses: []
      }


}   


  componentDidMount() {
    axios.get(`https://ywchw-221815.firebaseio.com/courses.json`).then((response) => {
      console.log(response)
      alert(response)
    });
  }


  render() {
    return (
      <div>
        <Header />
        <Search />

        <Item nameCourse={this.state.courses} />
        <Item />
        <Item />
        <Item />
        <Item />
      </div>
    )
  }
}

export default Home
